import React, { Component } from 'react';
import './mainVoteContent.css';

class Subject extends Component {
  render(){
    return (
      <header>
        <div class="JM_VOTE_CONTENT">
          <div class="content_1">
            <div class="cont1_img">
              <button class="share_cont"></button>
              <button class="love_cont"></button>
            </div>
            <div class="cont1_text">
              <div class=""></div>
            </div>
          </div>
        </div>
      </header>
    );
  }
}

export default Subject;
